class Djikstra {
    constructor(weightedEdges, n, k) {
        this.weightedEdges = weightedEdges;
        this.n = n;
        this.start = k;

        this.edgeMap = new Map();
        this.initMap();
        
        this.table = [];
        this.initTable();
        
        this.queue = [k];
        this.visited = new Set();
    }
    
    initTable() {
        for (let i=1; i<= this.n; i++) {
            this.table[i] = { node: i, distance: Infinity, previousNode: null, visited: false };
        }
    }
    
    initMap() {
        let entry;
        
        for (let i=0; i<this.weightedEdges.length; i++) {
            entry = this.edgeMap.get(this.weightedEdges[i][0]);
            if (!entry) {
                entry = [];
                this.edgeMap.set(this.weightedEdges[i][0], entry);
            }
            entry.push( { target: this.weightedEdges[i][1], weight: this.weightedEdges[i][2] });
        }
        
        // sorting is an IMPORTANT step to get the RIGHT answer!
        // could replace this with a MIN HEAP!        
        for (let i=1; i<=this.edgeMap.size; i++) {
            let edge = this.edgeMap.get(i);
            if (edge) {
                edge = edge.sort((a, b) => {
                return a.weight - b.weight; 
                });
                // console.dir(edge);
                this.edgeMap.set(i, edge);
            }
        }
        
        // console.log("map:");
        // console.dir(this.edgeMap);
    }
    
    maxTime() {
        let max = -1;
        
        for (let i=1; i<=this.n; i++) {
            if (!this.table[i].visited) {
                return -1;
            }
            
            if (this.table[i].distance > max) {
                max = this.table[i].distance;
            }
        }
        
        return max;
    }
    
//     totalTimes() {
//         let maxDistance = 0;
//         let entry;
        
//         for (let i=this.n; i>0; i--) {
//             entry = this.table[i];
//             while (entry.previousNode !== null) {
//                 this.table[i].total += entry.distance;
//                 entry = this.table[entry.previousNode];
//             }
            
//             if (entry.node !== this.start) {
//                 return -1;
//             }
            
//             if (this.table[i].total > maxDistance) {
//                 maxDistance = this.table[i].total;
//             }
//         }
        
//         return maxDistance;
//     }
    
    computeTimes(currentDistance) {
        while (this.queue.length > 0) {
            let currentNode = this.queue.pop();
            this.visited.add(currentNode);
            this.table[currentNode].visited = true;
        
            let edges = this.edgeMap.get(currentNode);
            for (let i=0; edges && i<edges.length; i++) {
                // console.log(this.table[currentNode].distance);
                let totalDistance;
                if (this.table[currentNode].distance === Infinity) {
                    totalDistance = edges[i].weight;
                } else {
                    totalDistance = edges[i].weight + this.table[currentNode].distance;
                }
                
                if (totalDistance < this.table[edges[i].target].distance) {
                    this.table[edges[i].target].distance = totalDistance;
                    this.table[edges[i].target].previousNode = currentNode;
                }
                
                if (!this.visited.has(edges[i].target)) {
                    this.queue.unshift(edges[i].target);
                }
            }
        }
        
        this.table[this.start].distance = 0;
        let result = this.maxTime();
        
        // console.log("table");
        // console.log(this.table);
        
        return result;
    }
    
    // computeTimes() {
    //     return this.computeTimesPrime(this.start);
    // }
    
    
}

